import React, { Component } from "react";

export class About extends Component {
  render() {
    const style = {
      container: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
      },
      text: {
        color: "white",
        fontWeight: "bold",
        fontSize: "2rem",
        marginBottom: "2em",
      },
    };

    return (
      <div style={style.container}>
        <span style={style.text}>
          This is a project for my portfolio, just for fun and practice
          purposes.
        </span>
        <a href="https://github.com/kevsbry/mophoria.git" target="_blank">
          Github Repository
        </a>
      </div>
    );
  }
}

export default About;
